5.0','2025-03-06 10:53:06','admin','2025-03-06 00:00:00','2025-03-04 00:00:00',0,'0','System Auto Run','2025-04-01 13:22:31','0',1,100,'&lt;h2 class=&quot;text-success&quot;&gt;Program Details&lt;/h2&gt;&lt;p&gt;&lt;strong&gt;Location:&lt;/strong&gt;&amp;nbsp;Chiang Mai province &amp;ndash; Northern Thailand&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Nearest Airport:&lt;/strong&gt;&amp;nbsp;Chiang Mai (CNX)&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Duration:&lt;/strong&gt;&amp;nbsp;Half Day Afternoon&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Please see the Availability Calendar - Select your preferred date to Book Now !&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Elephant Nature Park is a sanctuary for many rescued elephants, enabling them to live out their lives in their own social groups, roaming the pasture freely.&lt;br&gt;The half-day afternoon program at Elephant Nature Park offers a unique opportunity to spend quality time observing and being with the magnificent elephant herd. We prioritise creating a relaxed and immersive experience, allowing visitors to truly appreciate and learn from these incredible creatures.&lt;/p&gt;',1),(6,'โปรแกรม','Program Package Ticker ','2','THB',1,'2025-03-17 09:04:53',1,'admin','นายAdmin 5.0','2025-03-17 09:04:53',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-03-17 09:04:53','admin','2025-03-17 00:00:00','2025-03-04 00:00:00',0,'0','System Auto Run','2025-04-01 13:22:31','0',1,100,'&lt;h2 class=&quot;text-success&quot;&gt;Program Details&lt;/h2&gt;&lt;p&gt;&lt;strong&gt;Location:&lt;/strong&gt;&amp;nbsp;Chiang Mai province &amp;ndash; Northern Thailand&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Nearest Airport:&lt;/strong&gt;&amp;nbsp;Chiang Mai (CNX)&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Duration:&lt;/strong&gt;&amp;nbsp;Half Day Afternoon&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Please see the Availability Calendar - Select your preferred date to Book Now !&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Elephant Nature Park is a sanctuary for many rescued elephants, enabling them to live out their lives in their own social groups, roaming the pasture freely.&lt;br&gt;The half-day afternoon program at Elephant Nature Park offers a unique opportunity to spend quality time observing and being with the magnificent elephant herd. We prioritise creating a relaxed and immersive experience, allowing visitors to truly appreciate and learn from these incredible creatures.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;h2 class=&quot;text-success&quot;&gt;Program Details&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Starting From:&amp;nbsp;12:00 pm - 12:30 pm - We offer convenient pick-up from your Chiang Mai city hotel. Alternatively, you can meet us at our office at 11:45 am -&amp;nbsp;(Please check map)&amp;nbsp;If you are staying out of town (outside Middle ring-road) additional charges apply. Please advise on your reservation form.&lt;/li&gt;&lt;li&gt;2:00 pm - Arrival at Elephant Nature Park.&amp;nbsp;Embark on a guided walk with our knowledgeable staff and the elephants, emphasising a no-riding policy. We will take you to the river that skirts the park, where you can observe and learn about the elephants&amp;acute; habitat and history.&lt;/li&gt;&lt;li&gt;4:00 pm - Snack Break:&amp;nbsp;Indulge in a delicious assortment of snacks, seasonal fruits, and refreshing drinks specially prepared for your group. Take this opportunity to enjoy the view of the elephant herd from our elevated platform&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;5:00 pm - It&amp;acute;s time to bid farewell to the elephants and Elephant Nature Park, as we begin the hour-long drive back to Chiang Mai. We will drop you off at your hotel or our ENP office, as per your preference&lt;/p&gt;&lt;h2 class=&quot;text-success&quot;&gt;&amp;nbsp;&lt;/h2&gt;&lt;h2 class=&quot;text-success&quot;&gt;Included in the Program&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Meals:&lt;/strong&gt;&amp;nbsp;Snacks, seasonal fruits, and a variety of beverages such as tea, coffee, and soft drinks.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Transportation:&lt;/strong&gt;&amp;nbsp;We provide convenient round-trip transportation between Chiang Mai city office and Elephant Nature Park.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Admission Fees:&lt;/strong&gt;&amp;nbsp;All necessary entrance fees are included for your visit to Elephant Nature Park.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Park Guides:&lt;/strong&gt;&amp;nbsp;Knowledgeable guides will accompany you throughout the program, offering valuable insights and information about the park and its resident elephants.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Insurance&lt;/strong&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;We invite you to join us at Elephant Nature Park, where you can connect with these majestic creatures and experience an unforgettable morning filled with wonder and learning.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;',1),(7,'Program Package Ticker Special','Program Package Ticker Special','1','THB',1,'2025-03-19 14:20:27',1,'admin','นายAdmin 5.0','2025-03-19 14:20:27',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-03-19 14:20:27','admin','2025-01-01 00:00:00','2025-03-04 00:00:00',0,'0','System Auto Run','2025-04-01 13:22:31','0',1,100,'&lt;h3&gt;&lt;a href=&quot;https://www.elephantnaturepark.org/enp/visit-volunteer/projects/overnight-elephant-nature-park-2days-1night-43/view&quot;&gt;ENP - Overnight (2 Days + 1 Night)&lt;/a&gt;&lt;/h3&gt;&lt;div class=&quot;project-snippet&quot;&gt;Sleepovers in the midst of a thriving elephant herd offers visitors the chance to enjoy the simple rustic nature of Northern Thailand in the unique company of our rescued herd. We pick up from your hotel for a scenic drive north to Elephant Nature Park where you will meet our magnificent elephant herd. Observe our herd at play and watch them interact in each of their social groups. Full dinner at the park and accommodation at park huts. After breakfast, walk to see the elephants roaming in the open pasture.&lt;/div&gt;&lt;div class=&quot;project-snippet&quot;&gt;&amp;nbsp;&lt;/div&gt;&lt;div class=&quot;project-snippet&quot;&gt;&lt;h3&gt;&lt;a href=&quot;https://www.elephantnaturepark.org/enp/visit-volunteer/projects/sunshine-for-elephants-110/view&quot;&gt;Sunshine for Elephants&lt;/a&gt;&lt;/h3&gt;&lt;div class=&quot;project-snippet&quot;&gt;Sunshine for Elephants is an ethical elephant project in a wonderful location, providing a safe and caring home in nature for rescued elephants. Almost a decade ago, this elephant camp stopped offering elephant riding and transitioned to our Saddle Off model to allow elephants to live a more natural life.&lt;/div&gt;&lt;/div&gt;',1),(8,'Program2603','Program2603','1','THB',1,'2025-03-26 10:10:02',1,'admin','นายAdmin 5.0','2025-05-14 09:05:41',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-05-14 09:05:41','admin','2025-03-26 00:00:00','2025-12-31 00:00:00',1,'0','System Auto Run','2025-05-13 17:52:14','0',1,100,'&lt;h2 class=&quot;text-success&quot;&gt;Program Details&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Starting From:&amp;nbsp;12:00 pm - 12:30 pm - We offer convenient pick-up from your Chiang Mai city hotel. Alternatively, you can meet us at our office at 11:45 am -&amp;nbsp;(Please check map)&amp;nbsp;If you are staying out of town (outside Middle ring-road) additional charges apply. Please advise on your reservation form.&lt;/li&gt;&lt;li&gt;2:00 pm - Arrival at Elephant Nature Park.&amp;nbsp;Embark on a guided walk with our knowledgeable staff and the elephants, emphasising a no-riding policy. We will take you to the river that skirts the park, where you can observe and learn about the elephants&amp;acute; habitat and history.&lt;/li&gt;&lt;li&gt;4:00 pm - Snack Break:&amp;nbsp;Indulge in a delicious assortment of snacks, seasonal fruits, and refreshing drinks specially prepared for your group. Take this opportunity to enjoy the view of the elephant herd from our elevated platform&lt;/li&gt;&lt;li&gt;5:00 pm - It&amp;acute;s time to bid farewell to the elephants and Elephant Nature Park, as we begin the hour-long drive back to Chiang Mai. We will drop you off at your hotel or our ENP office, as per your preference&lt;/li&gt;&lt;/ul&gt;',1),(9,'enp-testprogram HDM','Half Day Morning ENP Test','2','THB',1,'2025-05-15 17:04:42',1,'admin','นายAdmin 5.0','2025-05-15 17:06:25',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-05-15 17:06:25','admin','2025-05-18 00:00:00','2026-02-28 00:00:00',1,NULL,NULL,NULL,NULL,2,40,'&lt;h2&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Half Day Morning Visit to Elephant Nature Park Sanctuary&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/h2&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Location:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; Chiang Mai province &amp;ndash; Northern Thailand&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Nearest Airport:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; Chiang Mai (CNX)&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Duration:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; Half Day Morning&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Please see the Availability Calendar - Select your preferred date to Book Now !&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Elephant Nature Park is a sanctuary for many rescued elephants, enabling them to live out their lives in their own social groups, roaming the pasture freely.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;The Half Day morning program offers a unique opportunity to spend quality time at Elephant Nature Park Sanctuary, observing and being with the magnificent elephant herd. We prioritize creating a relaxed and immersive experience, allowing visitors to truly appreciate and learn from these incredible creatures.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;This program warmly welcomes all visitors to Elephant Nature Park Sanctuary and offer facilities to accommodate wheelchair users. If you use a wheelchair or have specific accessibility needs, please contact us via email before booking our half-day tour. This allows us to ratify necessary details and ensure that your needs are accommodated. We do not however supply wheelchairs.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Program Details:&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Starting From:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; 7:30 am - 8:00 am - We offer convenient pick-up from your Chiang Mai city hotel. Alternatively, you can meet us at our office at 7:15 am - &lt;/span&gt;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;( &lt;/span&gt;&lt;/span&gt;&lt;a title=&quot;Please check map&quot; href=&quot;https://www.google.com/maps/d/edit?mid=zRtxhEsQybgQ.k06JQDqP1Egs&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Please check map&lt;/span&gt;&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; )&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; If you are staying out of town ( &lt;/span&gt;&lt;/span&gt;&lt;a title=&quot;outside Middle ring-road&quot; href=&quot;https://www.google.com/maps/d/edit?mid=zRtxhEsQybgQ.k06JQDqP1Egs&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;outside Middle ring-road&lt;/span&gt;&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; ) additional charges apply. Please advise on your reservation form.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;9:30 am - Arrival at Elephant Nature Park Sanctuary.&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; Embark on a guided walk with our knowledgeable staff and the elephants, emphasizing a no-riding policy. We will take you to the river that skirts the park, where you can observe and learn about the elephants&amp;acute; habitat and history.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;12:00 noon - Lunch&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; : Indulge in a healthy and diverse vegan buffet featuring a range of Asian and International dishes.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;1:00 pm - After lunch&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; , it&amp;acute;s time to bid farewell to the elephants and Elephant Nature Park, as we begin the hour-long drive back to Chiang Mai. We will drop you off at your hotel or our ENP office, as per your preference.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Included in the Program:&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Meals:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; Enjoy a delectable vegan buffet lunch that offers a variety of dishes inspired by Asian and International cuisines.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Transportation:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; We provide convenient round-trip transportation between Chiang Mai city office and Elephant Nature Park Sanctuary.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Admission Fees:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; All necessary entrance fees are included for your visit to Elephant Nature Park Sanctuary.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Park Guides:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; Knowledgeable guides will accompany you throughout the program, offering valuable insights and information about the park and its resident elephants.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Insurance&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;We invite you to join us at Elephant Nature Park Sanctuary, where you can connect with these majestic creatures and experience an unforgettable morning filled with wonder and learning.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Other Information&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;/strong&gt;&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Baggage / Luggage Allowance:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; One small day pack per person.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;What to Bring:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; hat, sunscreen, sandals/flip flops, shoes for walking, camera, bug repellent, refillable water bottle, (rain jacket in the rainy season, May - October).&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Trip Operational Months:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; All Year Round.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Age Suitability:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; All from infants to retirees.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Trip Costs (per person)&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Adult Rate:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; 2,500 Baht&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Child Rate:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; 1,250 Baht ( -11 yrs)&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;Bookings close:&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt;&lt;span style=&quot;vertical-align: inherit;&quot;&gt; 2 pm (GMT+7), on the day before you are due to visit. A deposit is required to secure your place(s).&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;',1),(10,'Half Day Afternoon Visit to Elephant Nature Park Sanctuary','Half Day Afternoon Visit to Elephant Nature Park Sanctuary','1','THB',1,'2025-05-20 16:54:22',1,'admin','นายAdmin 5.0','2025-05-20 17:25:46',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-05-20 17:25:46','admin','2025-05-20 00:00:00','2026-05-31 00:00:00',1,NULL,NULL,NULL,NULL,2,40,'&lt;h2&gt;&lt;strong&gt;Half Day Afternoon Visit to Elephant Nature Park Sanctuary&lt;/strong&gt;&lt;/h2&gt;&lt;p&gt;&lt;strong&gt;Location:&lt;/strong&gt;&amp;nbsp;Chiang Mai province &amp;ndash; Northern Thailand&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Nearest Airport:&lt;/strong&gt;&amp;nbsp;Chiang Mai (CNX)&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Duration:&amp;nbsp;&lt;/strong&gt;Half Day Afternoon&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Please see the Availability Calendar - Select your preferred date to Book Now !&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Elephant Nature Park is a sanctuary for many rescued elephants, enabling them to live out their lives in their own social groups, roaming the pasture freely.&lt;/p&gt;&lt;p&gt;The Half Day afternoon program at Elephant Nature Park Sanctuary offers a unique opportunity to spend quality time observing and being with the magnificent elephant herd. We prioritise creating a relaxed and immersive experience, allowing visitors to truly appreciate and learn from these incredible creatures.&lt;/p&gt;&lt;p&gt;This program warmly welcomes all visitors to Elephant Nature Park Sanctuary and offer facilities to accommodate wheelchair users. If you use a wheelchair or have specific accessibility needs, please contact us via email before booking our half-day tour. This allows us to ratify necessary details and ensure that your needs are accommodated. We do not however supply wheelchairs.&lt;/p&gt;&lt;h3&gt;Program Details:&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Starting From:&lt;/strong&gt;&amp;nbsp;12:00 pm - 12:30 pm - We offer convenient pick-up from your Chiang Mai city hotel. Alternatively, you can meet us at our office at 11:45 am -&amp;nbsp;&lt;strong&gt;(&lt;a title=&quot;Please check map&quot; href=&quot;https://www.google.com/maps/d/edit?mid=zRtxhEsQybgQ.k06JQDqP1Egs&quot;&gt;Please check map&lt;/a&gt;)&amp;nbsp;&lt;/strong&gt;If you are staying out of town (&lt;a title=&quot;outside Middle ring-road&quot; href=&quot;https://www.google.com/maps/d/edit?mid=zRtxhEsQybgQ.k06JQDqP1Egs&quot;&gt;outside Middle ring-road&lt;/a&gt;) additional charges apply. Please advise on your reservation form.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;2:00 pm - Arrival at Elephant Nature Park Sanctuary.&lt;/strong&gt;&amp;nbsp;Embark on a guided walk with our knowledgeable staff and the elephants, emphasising a no-riding policy. We will take you to the river that skirts the park, where you can observe and learn about the elephants&amp;acute; habitat and history.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;4:00 pm - Snack Break:&lt;/strong&gt;&amp;nbsp;Indulge in a delicious assortment of snacks, seasonal fruits, and refreshing drinks specially prepared for your group. Take this opportunity to enjoy the view of the elephant herd from our elevated platform.&amp;nbsp;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;5:00 pm&lt;/strong&gt;&amp;nbsp;- It&amp;acute;s time to bid farewell to the elephants and Elephant Nature Park, as we begin the hour-long drive back to Chiang Mai. We will drop you off at your hotel or our ENP office, as per your preference&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;&lt;strong&gt;Included in the Program:&lt;/strong&gt;&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Meals:&lt;/strong&gt;&amp;nbsp;Snacks, seasonal fruits, and a variety of beverages such as tea, coffee, and soft drinks.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Transportation:&lt;/strong&gt;&amp;nbsp;We provide convenient round-trip transportation between Chiang Mai city office and Elephant Nature Park Sanctuary.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Admission Fees:&lt;/strong&gt;&amp;nbsp;All necessary entrance fees are included for your visit to Elephant Nature Park Sanctuary.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Park Guides:&lt;/strong&gt;&amp;nbsp;Knowledgeable guides will accompany you throughout the program, offering valuable insights and information about the park and its resident elephants.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Insurance&lt;/strong&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;We invite you to join us at Elephant Nature Park, where you can connect with these majestic creatures and experience an unforgettable morning filled with wonder and learning.&lt;/p&gt;&lt;h3&gt;&lt;strong&gt;Other Information&lt;br&gt;&lt;/strong&gt;&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Baggage / Luggage Allowance:&lt;/strong&gt;&amp;nbsp;One small day pack per person.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;What to Bring:&lt;/strong&gt;&amp;nbsp;hat, sunscreen, sandals/flip flops, shoes for walking, camera, bug repellent, refillable water bottle, (rain jacket in the rainy season, May - October).&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Trip Operational Months:&lt;/strong&gt;&amp;nbsp;All Year Round.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Age Suitability:&lt;/strong&gt;&amp;nbsp;All from infants to retirees.&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;Trip Costs (per person)&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Adult Rate:&lt;/strong&gt;&amp;nbsp;2,500 Baht&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Child Rate:&lt;/strong&gt;&amp;nbsp;1,250 Baht ( -11 yrs)&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Bookings close:&lt;/strong&gt; 2 pm (GMT+7), on the day before you are due to visit. A deposit is required to secure your place(s).&lt;/p&gt;',1),(11,'Programs  Test','Programs  Test','1','THB',1,'2025-05-23 09:54:03',1,'admin','นายAdmin 5.0','2025-05-23 10:18:02',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-05-23 10:18:02','admin','2025-05-23 00:00:00','2025-05-30 00:00:00',1,NULL,NULL,NULL,NULL,2,30,'&lt;h2 class=&quot;text-success&quot;&gt;Program Details&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Starting From:&amp;nbsp;12:00 pm - 12:30 pm - We offer convenient pick-up from your Chiang Mai city hotel. Alternatively, you can meet us at our office at 11:45 am -&amp;nbsp;(Please check map)&amp;nbsp;If you are staying out of town (outside Middle ring-road) additional charges apply. Please advise on your reservation form.&lt;/li&gt;&lt;li&gt;2:00 pm - Arrival at Elephant Nature Park.&amp;nbsp;Embark on a guided walk with our knowledgeable staff and the elephants, emphasising a no-riding policy. We will take you to the river that skirts the park, where you can observe and learn about the elephants&amp;acute; habitat and history.&lt;/li&gt;&lt;li&gt;4:00 pm - Snack Break:&amp;nbsp;Indulge in a delicious assortment of snacks, seasonal fruits, and refreshing drinks specially prepared for your group. Take this opportunity to enjoy the view of the elephant herd from our elevated platform&lt;/li&gt;&lt;li&gt;5:00 pm - It&amp;acute;s time to bid farewell to the elephants and Elephant Nature Park, as we begin the hour-long drive back to Chiang Mai. We will drop you off at your hotel or our ENP office, as per your preference&lt;/li&gt;&lt;/ul&gt;',1),(12,'Program Dollars','Program Dollars','1','USD',1,'2025-05-23 10:57:07',1,'admin','นายAdmin 5.0','2025-05-23 10:57:26',1,'admin','นายAdmin 5.0','1','นายAdmin 5.0','2025-05-23 10:57:26','admin','2025-05-23 00:00:00',NULL,1,NULL,NULL,NULL,NULL,2,40,'&lt;h2 class=&quot;text-success&quot;&gt;Program Details&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Starting From:&amp;nbsp;12:00 pm - 12:30